import React, { useState } from "react";

export default function StaffGrade() {
  const [grades, setGrades] = useState([
    {
      id: 1,
      name: "Junior",
      serviceIncentive: 5,
      productIncentive: 3,
      active: true
    },
    {
      id: 2,
      name: "Senior",
      serviceIncentive: 10,
      productIncentive: 6,
      active: true
    }
  ]);

  const [newGrade, setNewGrade] = useState({
    name: "",
    serviceIncentive: "",
    productIncentive: ""
  });

  const addGrade = () => {
    if (!newGrade.name) return;

    setGrades([
      ...grades,
      {
        id: Date.now(),
        name: newGrade.name,
        serviceIncentive: Number(newGrade.serviceIncentive),
        productIncentive: Number(newGrade.productIncentive),
        active: true
      }
    ]);

    setNewGrade({ name: "", serviceIncentive: "", productIncentive: "" });
  };

  const toggleStatus = id => {
    setGrades(
      grades.map(g =>
        g.id === id ? { ...g, active: !g.active } : g
      )
    );
  };

  const removeGrade = id => {
    setGrades(grades.filter(g => g.id !== id));
  };

  return (
    <div className="card">
      <h3>Staff Grade</h3>

      {/* Add Grade */}
      <div className="form-row">
        <input
          placeholder="Grade Name"
          value={newGrade.name}
          onChange={e =>
            setNewGrade({ ...newGrade, name: e.target.value })
          }
        />
        <input
          type="number"
          placeholder="Service Incentive %"
          value={newGrade.serviceIncentive}
          onChange={e =>
            setNewGrade({
              ...newGrade,
              serviceIncentive: e.target.value
            })
          }
        />
        <input
          type="number"
          placeholder="Product Incentive %"
          value={newGrade.productIncentive}
          onChange={e =>
            setNewGrade({
              ...newGrade,
              productIncentive: e.target.value
            })
          }
        />
        <button className="btn-primary" onClick={addGrade}>
          Add
        </button>
      </div>

      {/* Grade Table */}
      <table className="table" style={{ marginTop: 20 }}>
        <thead>
          <tr>
            <th>Grade</th>
            <th>Service %</th>
            <th>Product %</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {grades.map(grade => (
            <tr key={grade.id}>
              <td>{grade.name}</td>
              <td>{grade.serviceIncentive}%</td>
              <td>{grade.productIncentive}%</td>
              <td>
                <button
                  onClick={() => toggleStatus(grade.id)}
                  style={{
                    background: grade.active ? "#ff4d00" : "#ccc",
                    color: "#fff",
                    border: "none",
                    padding: "4px 10px",
                    cursor: "pointer"
                  }}
                >
                  {grade.active ? "Active" : "Inactive"}
                </button>
              </td>
              <td>
                <button onClick={() => removeGrade(grade.id)}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
          {grades.length === 0 && (
            <tr>
              <td colSpan="5" align="center">
                No grades added
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
